import React from 'react';
import styled from 'styled-components';
import BrandLogo from '../brandLogo';
import sjsu from "../../images/thumbnails/SJSU.jpg"
import { Marginer } from '../marginer';


const SpecialistContainer = styled.div`
width: 100%;
height: 500px;
display: flex;
background-color: #264653;
align-items:center;
justify-items: center;
`;

const ContentContainer = styled.div`
width: 100%;
display: flex;
align-items: center;
justify-content: center;
`;

const SloganContainer = styled.div`
    display: flex;
    flex-direction: column;
`;

const Slogan = styled.div`
    margin: 0;
    font-size: 2em;
    color: #fff;
    font-weight: 500;
`;

const StandoutImage = styled.div`
width: 35em;
height: 35em;
img {
    width: 100%;
    height: 100%;
}
`;

export default function SpecialistAdd(props) {
    return (
        <SpecialistContainer>
            <ContentContainer>
                <SloganContainer>
                    <BrandLogo />
                    <Marginer direction="vertical" margin="1em"/>
                    <SloganContainer>
                        <Slogan>ABOUT US</Slogan>
                        <Slogan>A couple of Engineering Students who created an</Slogan>
                        <Slogan>Employee Management Website for fun!</Slogan>
                        <Slogan>The four students attending San Jose State University</Slogan>
                        <Slogan>Are: Aman Kaur, Alireza Mahin Parvar, Elizabeth Na, Prince Jassal</Slogan>
                    </SloganContainer>
                    <Marginer direction="vertical" margin="1.3em" />
                    <StandoutImage>
                        <img src={sjsu} alt="university" />
                    </StandoutImage>
                </SloganContainer>
            </ContentContainer>

        </SpecialistContainer>

    );
};
